import "./sepet.style.css";


const SepetSayfasi = ({ cartItems }) => {
    return (
      <div>
        {cartItems && cartItems.length > 0 ? (
          <div>
            <h2>Sepet İçeriği</h2>
            <ul>
              {cartItems.map((item, index) => (
                <li key={index}>
                  {item.name}
                  
                </li>
              ))}
            </ul>
          </div>
        ) : (
          <p>Sepetinizde ürün bulunmamaktadır.</p>
        )}
      </div>
    );
  };
  
  export default SepetSayfasi;
